import React from "react";
import "../../App.css";
import styled from "styled-components";

const Container = styled.div``;

const LoginButton = styled.button`
  background: #891c1a;
  border-radius: 23px;
  border: none;
  color: white;
  height: 45px;
  width: 100px;
  padding: 0 10px;
`;

const TextInput = styled.input`
  height: 42px;
  padding: 0 10px;
`;

export default function Login() {
  return (
    <div
      style={{
        display: "flex",
        flex: 1,
        justifyContent: "center",
        alignContent: "center"
      }}
    >
      <LoginButton>I'm purple.</LoginButton>
      <TextInput></TextInput>
      <TextInput type="password"></TextInput>
    </div>
  );
}
